import customers from '../__mocks__/customers';

const INITIAL_STATE = {
    profile: {
        email: 'abc@gmail.com',
        userName: "Katarina Smith",
        password: 123,
        post: "Senior Developer"
    },

    profiles: customers,
    User
}

const reducer = (state = INITIAL_STATE ) => {
    return state
}

export default reducer;
